import React from 'react'
import { Navbar, Footer } from '../components';
import medicalReport from "../assets/diagnosis-medical-report-with-stethoscope-vector-19690081.jpg"

const DiagonsticCenter = () => {
  return (
    <div>
      <Navbar/>
      <div className='diagnosticCenter'>
      <img src={medicalReport} alt="medicalReport" /></div>
      <Footer/>
    </div>
  )
}

export default DiagonsticCenter
